import React, { Component } from "react"

async function update(state) {
    // console.log(document.getElementById("newURI").value);
    console.log(await state.contract.methods.owner().call());
}

function ChangeURI(props) {

    if (props.owner == true){
        return(
            <div>
                <input id = "newURI" type="text"></input>
                <a href = "#" onClick={update.bind(props.this)}>update</a>
            </div>
        );
    }
    else {
        return (<></>);
    }

}

export default ChangeURI;
